	(1665, 'https://ec.europa.eu/eurostat/documents/4187653/16828122/NDABCREATIVITY_AdobeStock_393351315_RV.jpg', 'Among the 1.5 million master’s students in the EU in 2022, 905 678 were women, representing 58.6% of the total. At doctoral level, this share was 48.5% of a total of 99 204 doctorate students.  At master’s level, women represented the majority of students in all EU countries, except for Luxembourg, where there was a gender balance with 49.8% of students being female. The highest share of women in master’s studies was recorded in Cyprus, with 74.2%, followed by Poland (67.3%) and Lithuania (66.1%).  For studies at doctoral level, shares ranged from 42.3% in Luxembourg, 43.3% in Austria and 44.1% in Czechia, to 57.4% in Lithuania, 58.0% in Cyprus and 59.6% in Latvia.  Source dataset: educ_uoe_grad02 Between 2013 and 2022, the share of women i'),
	(1666, 'https://ec.europa.eu/eurostat/documents/4187653/15726095/Jacob%20Lund_AdobeStock_360183188_RV.jpg', 'In 2022, employment in the environmental economy in the EU countries increased on average by 9.5% compared to 2021, measured in full-time equivalents. The increase ranged from 2.8% in Czechia to 38% in Greece while in Malta, Lithuania and Slovakia employment decreased in the same period.  Italy, Germany and Portugal experienced a significant increase of employment in energy resource management (+73%, +34% and +48%, respectively) in 2022 compared with the previous year. In waste management, employment in Italy decreased by 2.5%, while the employment went up in France and Germany by 1.6% and 4.6% and remained stable in Spain.  Across the EU countries, most employment in the environmental economy related to management of energy resources (34.8'),
	(1514, 'https://ec.europa.eu/eurostat/documents/2995521/18500214/Marian%20Weyo_shutterstock_384773458_RV.jpg', 'Euro area annual inflation is expected to be 2.4% in February 2025, down from 2.5% in January according to a flash estimate from Eurostat, the statistical office of the European Union. Looking at the main components of euro area inflation, services is expected to have the highest annual rate in February (3.7%, compared with 3.9% in January), followed by food, alcohol & tobacco (2.7%, compared with 2.3% in January), non-energy industrial goods (0.6%, compared with 0.5% in January) and energy (0.2%, compared with 1.9% in January). Tables Euro area annual inflation and its components (%) Weights (‰) Annual rate Monthly rate 2025 Feb 24 Sep 24 Oct 24 Nov 24 Dec 24 Jan 25 Feb 25 Feb 25 All-items HICP 1000.0 2.6 1.7 2.0 2.2 2.4 2.5 2.4e 0.5e All-'),
