	(1667, 'https://ec.europa.eu/eurostat/documents/4187653/15725031/diegograndi_AdobeStock_578095482_RV.jpg', 'In 2022, most of the services exports from the EU to non-EU countries (56%) were carried out by large enterprises with 250 or more employees. Small enterprises (up to 49 employees) accounted for 14% of exports and medium-sized enterprises (50 to 249 employees) for 10%, while the size of the exporting enterprise for the remaining 20% of exports is unknown. In most EU countries, large enterprises accounted for the majority of services exported outside the EU, with the largest contributions recorded in Finland (74%), Germany (72%) and Slovakia (70%). Small enterprises led exports in Malta (86%), Estonia (59%) and Luxembourg (49%), while medium-sized enterprises accounted for the majority of exports in Bulgaria (28%). Source dataset: ext_stec01'),
	(1668, 'https://ec.europa.eu/eurostat/documents/4187653/15353639/AnnaStills_shutterstock_2157593095_RV.jpg', 'In 2023, 1.1 million people acquired the citizenship of the EU country where they lived, an increase of around 6.1% (+60 200 people) compared with 2022. Most of the new citizenships were granted by Spain (240 200; 22.9% of the EU total), Italy (213 600; 20.3%) and Germany (199 800; 19.0%).  The majority (87.6%) of the people granted an EU citizenship were citizens of a non-EU country. Citizens of another EU country than the country of residence accounted for 10.7%.  This information comes from data on the acquisition of citizenship published by Eurostat today. This article presents just a handful of findings from the more detailed Statistics Explained article. Syrians, Moroccans and Albanians top 3 recipients In 2023, Syrian nationals were '),
