	(1477, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/ciced-visual-feb2025.png?itok=mjHw9KBH', 'Національні органи влади, які беруть участь у роботі спільної слідчої групи JIT, що підтримується Євроюстом, щодо ймовірних основних міжнародних злочинів, скоєних в Україні, вже опитали 4 000 свідків на додаток до понад 40 000 допитів, проведених українськими органами влади на їхній території. У результаті тісної співпраці між сторонами групи JIT (які представляють національні судові органи Литви, Естонії, Латвії, Польщі, Румунії, Словацької Республіки та України) Прокуратура Литви заочно видала повідомлення про підозру проти шести підозрюваних. Крім того, Офіс Генерального прокурора повідомив про підозру ще одній особі у скоєнні воєнних злочинів проти цивільного населення.'),
	(1478, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/ciced-visual-feb2025.png?itok=mjHw9KBH', 'Valstu iestādes, kas piedalās Eurojust atbalstītajā kopējā izmeklēšanas grupā (KIG) par iespējamiem galvenajiem starptautiskajiem noziegumiem, kas izdarīti Ukrainā, līdz šim ir intervējušas 4 000 liecinieku — papildus vairāk nekā 40 000 intervijām, ko Ukrainas iestādes veikušas savā teritorijā. Ciešās sadarbības rezultātā starp KIG pusēm (kas pārstāv Lietuvas, Igaunijas, Latvijas, Polijas, Rumānijas, Slovākijas Republikas un Ukrainas tiesu iestādes) Lietuvas prokuratūra ir aizmuguriski izdevusi paziņojumus par aizdomām pret sešiem aizdomās turētajiem. Turklāt Ukrainas Ģenerālprokuratūra ir izdevusi paziņojumu par aizdomām pret vēl vienu personu par kara noziegumiem pret civiliedzīvotājiem.'),
	(1479, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/ciced-visual-feb2025.png?itok=mjHw9KBH', 'Autoritățile naționale care participă la echipa comună de anchetă (ECA) sprijinită de Eurojust privind cele mai grave presupuse crime internaționale comise în Ucraina au intervievat, până în prezent, 4 000 de martori, pe lângă peste 40 000 de interviuri efectuate de autoritățile ucrainene pe propriul lor teritoriu. Ca urmare a cooperării strânse între părțile la ECA (ce reprezintă autoritățile judiciare naționale din Lituania, Estonia, Letonia, Polonia, România, Republica Slovacă și Ucraina), Ministerul Public din Lituania a emis, pe numele a șase suspecți, acte de aducere la cunoștință în lipsă a faptelor de care sunt suspectați. În plus, parchetul general din Ucraina a emis, pe numele altei persoane, un act de aducere la cunoștință a fapt'),
	(1480, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/ciced-visual-feb2025.png?itok=mjHw9KBH', 'Vnútroštátne orgány zapojené do činnosti spoločného vyšetrovacieho tímu (SVT), ktorý sa s podporou Eurojust zameriava na údajné najzávažnejšie medzinárodné trestné činy spáchané na Ukrajine, dosiaľ vypočuli 4 000 svedkov. Okrem toho ukrajinské orgány uskutočnili na svojom vlastnom území viac ako 40 000 rozhovorov. Vďaka úzkej spolupráci medzi zúčastnenými stranami SVT (zastupujúce vnútroštátne justičné orgány Litvy, Estónska, Lotyšska, Poľska, Rumunska, Slovenskej republiky a Ukrajiny) vydala litovská prokuratúra oznámenia o podozrení v neprítomnosti proti šiestim podozrivým osobám. Ukrajinská generálna prokuratúra navyše vydala oznámenie o podozrení proti inej osobe za vojnové zločiny proti civilistovi.'),
	(1481, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/ciced-visual-feb2025.png?itok=mjHw9KBH', 'Available in:EstonianLatvianLithuanianPolishRomanianSlovakUkrainianThe national authorities participating in the Eurojust-supported joint investigation team (JIT) on alleged core international crimes committed in Ukraine have interviewed 4 000 witnesses so far, in addition to over 40 000 interviews conducted by the Ukrainian authorities on their own territory. As a result of close cooperation between the JIT parties (representing the national judicial authorities of Lithuania, Estonia, Latvia, Poland, Romania, the Slovak Republic and Ukraine), the Lithuanian Prosecution Service has issued Notices of Suspicion in absentia against six suspects. In addition, the Office of the Prosecutor General of Ukraine has issued a Notice of Suspicion again'),
	(1482, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/ciced-visual-feb2025.png?itok=mjHw9KBH', 'Eurojusto remiamoje jungtinėje įtariamų sunkiausių tarptautinių nusikaltimų Ukrainoje tyrimo grupėje (JTG) dalyvaujančios nacionalinės institucijos iki šiol apklausė 4 000 liudytojų, be to, Ukrainos valdžios institucijos savo šalies teritorijoje apklausė daugiau kaip 40 000 liudytojų. Glaudžiai bendradarbiaujant JTG šalims (atstovaujančioms Lietuvos, Estijos, Latvijos, Lenkijos, Rumunijos, Slovakijos ir Ukrainos nacionalinėms teisminėms institucijoms), Lietuvos prokuratūra šešiems įtariamiesiems įteikė pranešimus apie įtarimus in absentia. Be to, Ukrainos generalinio prokuroro tarnyba pranešimą apie įtarimus vykdžius karo nusikaltimus prieš civilius įteikė dar vienam asmeniui.'),
	(1483, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/ciced-visual-feb2025.png?itok=mjHw9KBH', 'Ukrainas toime pandud raskeid rahvusvahelisi kuritegusid uurivas Eurojusti toetatud ühises uurimisrühmas osalevad riiklikud ametiasutused on seni küsitlenud 4000 tunnistajat lisaks üle 40 000 küsitlemisele, mille Ukraina ametiasutused on oma territooriumil läbi viinud. Ühise uurimisrühma osaliste (kes esindavad Leedu, Eesti, Läti, Poola, Rumeenia, Slovaki Vabariigi ja Ukraina õigusasutusi) tiheda koostöö tulemusena on Leedu prokuratuur väljastanud tagaseljateate kuue kahtlustatava suhtes. Lisaks sellele on Ukraina peaprokuratuur väljastanud kahtlustuse veel ühe isiku vastu tsiviilisikute vastu toime pandud sõjakuritegude eest.'),
	(1484, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/ciced-visual-feb2025.png?itok=mjHw9KBH', 'Organy krajowe, które uczestniczą we wspieranym przez Eurojust wspólnym zespole dochodzeniowo-śledczym (JIT) do spraw najpoważniejszych zbrodni wagi międzynarodowej, które według doniesień popełniono w Ukrainie, przesłuchały do tej pory 4 tys. świadków, nie licząc ponad 40 tys. przesłuchań przeprowadzonych przez organy ukraińskie na ich własnym terytorium. W wyniku ścisłej współpracy między stronami zespołu JIT (reprezentującymi krajowe organy wymiaru sprawiedliwości Litwy, Estonii, Łotwy, Polski, Rumunii, Słowacji i Ukrainy) prokuratura litewska wydała zaoczne zawiadomienia o podejrzeniu popełnienia przestępstwa przez sześciu podejrzanych. Ponadto biuro prokuratora generalnego Ukrainy wydało zawiadomienie o podejrzeniu popełnienia zbrodni '),
