	(1361, 'https://ec.europa.eu/eurostat/documents/4187653/15463456/tadamichi_shutterstock_518338273_RV.jpg', 'Eurostat and the national statistical authorities of all the EU and EFTA countries form a partnership called the European Statistical System (ESS). Together, we produce European statistics in accordance with a common quality framework. Twenty years ago, on 24 February 2005, the European Statistics Code of Practice (the Code) was adopted, becoming the cornerstone of the common quality framework of the ESS and ensuring the quality of European statistics. The European Statistics Code of Practice: a reason for trusting European statistics  Quality is a multi-faceted concept that affects all aspects of an institution’s operations. Quality in official statistics covers not only the statistical outputs, but also the statistical processes that prod'),
	(1362, 'https://ec.europa.eu/eurostat/documents/4187653/16073134/Cryptographer_Shutterstock_1675677712_RV.jpg', 'In the fourth quarter of 2024, the number of bankruptcy declarations of EU businesses decreased by 0.7% compared with the third quarter of 2024.  At the same time, business registrations went up by 2.6% compared with the third quarter of 2024.  This information comes from data on business registrations and bankruptcies published by Eurostat recently. This article presents a handful of findings from the more detailed Statistics Explained article.    Source dataset: sts_rb_q Business registrations rose in all sectors In the fourth quarter of 2024, data show that the number of business registrations went up in all sectors of the economy, when compared with the previous quarter. The highest increases in the number of registrations were in trans'),
	(1377, 'https://ec.europa.eu/eurostat/documents/2995521/18500211/Halfpoint_shutterstock_2153609389_RV.jpg', 'Overview The euro area annual inflation rate was 2.5% in January 2025, up from 2.4% in December 2024. A year earlier, the rate was 2.8%. European Union annual inflation was 2.8% in January 2025, up from 2.7% in December 2024. A year earlier, the rate was 3.1%. These figures are published by Eurostat, the statistical office of the European Union. The lowest annual rates were registered in Denmark (1.4%), Ireland, Italy and Finland (all 1.7%). The highest annual rates were recorded in Hungary (5.7%), Romania (5.3%) and Croatia (5.0%). Compared with December 2024, annual inflation fell in eight Member States, remained stable in four and rose in fifteen. In January 2025, the highest contribution to the annual euro area inflation rate came from '),
