	(1132, 'https://ec.europa.eu/eurostat/documents/2995521/18500199/yi_AdobeStock_305210002_RV.jpg', 'Overview In December 2024, compared with November 2024, seasonally adjusted production in construction remained stable in the euro area and increased by 0.4% in the EU, according to first estimates from Eurostat, the statistical office of the European Union. In November 2024, production in construction grew by 0.6% in the euro area and by 0.8% in the EU. In December 2024, compared with December 2023, production in construction decreased by 0.1% the euro area and by 0.8% in the EU. The annual average production in construction for the year 2024, compared with 2023, decreased by 0.9% in the euro area and by 1.3% in the EU. Monthly comparison by construction sector and by Member State In the euro area in December 2024, compared with November 2'),
	(1191, 'https://ec.europa.eu/eurostat/documents/4187653/15566018/StratfordProductions_AdobeStock_274989153_RV.jpg', 'Online shopping in the EU continues to expand, according to the latest annual survey on ICT usage in households and by individuals. In 2024, 77%  of internet users bought or ordered goods or services for personal use online in the previous 12 months, increasing from 59% in 2014, marking a 17 percentage point (pp) rise. The highest percentages of internet users who made online purchases in 2024 were in Ireland (96%), the Netherlands (94%) and Denmark (91%). Conversely, Bulgaria had the lowest share at 57%, followed by Italy and Romania, both at 60%. From 2014 to 2024, significant growth was observed in Romania (+43 pp, from 17% to 60%), Hungary (+37 pp, 42% to 79%), and Lithuania (+36 pp, 36% to 72%).  Source datasets: isoc_ec_ib20 and isoc_'),
	(1192, 'https://ec.europa.eu/eurostat/documents/4187653/16693923/donvictorio_shutterstock_%20172537049_RV.jpg', 'In the final quarter of 2024, the EU exported more goods to non-EU countries than it imported, resulting in a trade surplus of €27.2 billion. This marked the sixth consecutive quarter of a positive trade balance, following a period of deficits driven by soaring energy costs from late 2021 to mid-2023. The positive trade balance in the fourth quarter of 2024 was driven by surpluses in trade in chemicals and related products (+€60.1 billion), machinery and vehicles (+€48.0 billion), food and drink (+€10.7 billion) and other goods (+€5.5 billion). In contrast, trade deficits were reported for energy (-€82.8 billion), raw materials (-€7.2 billion) and other manufactured goods (-€7.1 billion). Source dataset: ext_st_eu27_2020sitc In the fourth q'),
	(1193, 'https://ec.europa.eu/eurostat/documents/4187653/16699826/background%20photo_AdobeStock_391076890_RV.jpg', 'In December 2024, the domestic producer price for energy in the EU increased by 1.3% compared with the previous month, while it decreased by 1.4% compared with December 2023. However, between January 2021 and December 2024, the price went up by 80.3%.  For electricity and gas supply, the price saw an increase of 1.6% in December 2024 compared with November 2024, while it dropped by 0.4% compared with December 2023.  Regarding the extraction of crude petroleum and natural gas, the price went up by 1.6% between November and December 2024. It increased by 7% between December 2023 and December 2024.   This information comes from data on domestic industrial producer process, published by Eurostat every month. Source dataset: sts_inppd_m'),
	(1176, 'https://static.euronews.com/articles/stories/09/06/85/36/1200x675_cmsv2_a2b35d87-3487-568c-a12a-dee3c707271a-9068536.jpg', 'According to recently released minutes of the 28-29 January meeting, officials said President Trump\'s proposed tariffs and mass deportations of migrants, as well as strong consumer spending, were factors that could push inflation higher this year.'),
