	(1194, 'https://ec.europa.eu/eurostat/documents/4187653/21029070/Tryfonov_AdobeStock_318903548_RV.jpg', 'In January 2025, Eurostat released a new geospatial dataset describing accessibility of healthcare and education services by road transport. It aims to identify potential population clusters with low or limited road transport access to healthcare and primary education services. The census 2021 population grid at 1 km resolution and geographical data for road network were used to assess driving time to the nearest services in 2020 and 2023. The 2025 release follows the launch of a geospatial dataset describing healthcare and education services in Europe in 2023, which included their location. This dataset combines information from existing registries maintained by various public authorities across EU countries, such as health and education m'),
	(1195, 'https://ec.europa.eu/eurostat/documents/4187653/15739994/Dmitrijs%20Dmitrijevs_AdobeStock_10603002_RV.jpg', 'In 2022, the greenhouse gas footprint of goods and services consumed in the EU amounted to 10.7 tonnes of carbon dioxide (CO2) equivalents per capita. This indicator considers emissions generated throughout the production chains of products consumed in the EU, including emissions embedded in imported goods and services. Among EU countries, the lowest greenhouse gas footprints were recorded in Sweden (7.9 tonnes of CO2 equivalents per capita), Portugal and Romania (8.0 tonnes each).  In contrast, the highest footprints per capita were recorded in Cyprus (16.6 tonnes), Luxembourg (15.5 tonnes) and Ireland (14.2 tonnes). Source dataset: cli_gge_foot This article presents the key findings from the more detailed Statistics Explained article on g'),
