	(1010, 'https://ec.europa.eu/eurostat/documents/4187653/15353639/Vanja%20Stokic_Shutterstock_2137169587_RV.jpg', 'In November 2024, 75 045 first-time asylum applicants (non-EU citizens) applied for international protection in EU countries, marking a 14% decrease compared with October 2024 (86 920) and a 31% decrease compared with November 2023 (108 895).  There were also 6 430 subsequent applicants, representing a 14% decrease compared with October 2024 (7 475) and a 5% decrease compared with November 2023 (6 740). This information comes from the monthly asylum data published by Eurostat today.  Source dataset: migr_asyappctzm Syrians remain the largest group of asylum seekers In November 2024, Syrians remained the largest group of people seeking asylum (11 565 first-time applicants), followed by Venezuelans (7 210) and Afghans (5 880). Germany, Spain,'),
