	(878, 'https://ec.europa.eu/eurostat/documents/2995521/18500184/Marian%20Weyo_shutterstock_512719735_RV.jpg', 'GDP growth in the euro area and EU In the fourth quarter of 2024, seasonally adjusted GDP increased by 0.1% in the euro area and by 0.2% the EU, compared with the previous quarter, according to a flash estimate published by Eurostat, the statistical office of the European Union. In the third quarter of 2024, GDP had grown by 0.4% in both areas. According to an estimation of annual growth for 2024, based on seasonally and calendar adjusted quarterly data, GDP increased by 0.7% in the euro area and by 0.9% in the EU. Compared with the same quarter of the previous year, seasonally adjusted GDP increased by 0.9% in the euro area and by 1.1% in the EU in the fourth quarter of 2024, after +0.9% in the euro area and +1.0% in the EU in the previous'),
	(762, 'https://ec.europa.eu/eurostat/documents/4187653/21006281/Kwangmoozaa_AdobeStock_211241746_RV.jpg', 'In 2023, the total production of jewellery in the EU reached €4 363 million, marking a 1% increase from €4 321 million in 2022. Italy was the leading producer, with a production value of €1 559 million in 2023, or 36% of the EU’s total. France followed with €1 444 million (33%), ahead of Germany with €507 million (12%).  Source data: ds-056120 Compared with 2022, the largest relative increases in jewellery production value were reported in Croatia (+26%), Czechia (+25%) and Ireland (+20%). In contrast, the sharpest decreases were recorded in Lithuania (-36%), Latvia (16%) and Italy (-8%).'),
	(763, 'https://ec.europa.eu/eurostat/documents/4187653/15727800/martin33_AdobeStock_66652891_RV.jpg', 'In the third quarter of 2024, the EU economy greenhouse gas emissions were estimated at 767 million tonnes of CO2-equivalents (CO2-eq), a 0.6% decrease compared with the same quarter of 2023 (772 million tonnes of CO2-eq). The EU’s gross domestic product (GDP) registered a 1.3% increase in the third quarter of 2024, compared with the same quarter of 2023.  This information comes from data on quarterly estimates for greenhouse gas emissions by economic activity published by Eurostat today. Quarterly estimates of greenhouse gas emissions complement quarterly socio-economic data, such as GDP or employment.  This article presents the key findings from the more detailed Statistics Explained article on quarterly greenhouse gas emissions. Source d'),
