	(767, 'https://ec.europa.eu/eurostat/documents/4187653/15963623/Firma%20V_Shutterstock_533127811_RV.jpg', 'In 2023, real GDP increased in 154 EU regions compared with 2022, while decreases were registered in 85 regions.  The region with the largest growth in real GDP was Malta (a single region at this level of detail), with a 6.7% increase, followed by Severen Tsentralen in Bulgaria (+5.8%), Illes Balears and Canarias in Spain, (+5.7% and +5.1%, respectively) and Hovedstaden in Denmark (+5.0%). Unlike in 2022, when the highest fall in real GDP was 3%, in 2023, there was a 14.1% fall in Vorarlberg in Austria and a 12.9% fall in Provence-Alpes-Côte d’Azur. These were followed by Groningen in the Netherlands (-11.1%), the Southern region in Ireland (-10.9%) and Norra Mellansverige in Sweden (-7.7%).  5 EU regions registered no change in real GDP co'),
