	(548, 'https://ec.europa.eu/eurostat/documents/4187653/15537839/Alexander%20Steamaze_Shutterstock_1972202852_RV.jpg', 'In 2023, the share of renewable energy sources in transport reached 10.8% at EU level, a 1.2 percentage points (pp) increase from 2022 (9.6%).  This share was 18.2 pp lower than the 29% target for 2030 on the use of energy from renewable sources in transport. Meeting the target would require an annual average increase of 2.6 pp between 2024 and 2030. The average annual increase registered over the years 2014 to 2023 was 0.43 pp.  Sweden was the EU country with the highest share of renewables in transport and the only country already having achieved the 2030 target (33.7%). Ranking second was Finland (20.7%), followed by the Netherlands (13.4%) and Austria (13.2%). By contrast, the lowest shares were registered in Croatia (0.9%), Latvia (1.4'),
	(491, 'https://ec.europa.eu/eurostat/documents/2995521/18500154/Gorodenkoff_Shutterstock_1882428604_RV.png', 'Overview In November 2024, compared with October 2024, seasonally adjusted services production increased by 0.3% in both the euro area and the EU, according to first estimates from Eurostat, the statistical office of the European Union. Also in October 2024, services production rose by 0.3% in both the euro area and the EU. In November 2024, compared with November 2023, services production increased by 2.0% in the euro area and by 1.6% in the EU. Monthly comparison by service industry and by Member State In the euro area in November 2024, compared with October 2024, services production increased for transportation and storage by 0.3%, increased for accommodation and food services by 0.9%, increased for information and communication by 0.6%,'),
