	(549, 'https://ec.europa.eu/eurostat/documents/4187653/18570962/fizkes_AdobeStock_434009714_RV.jpg', 'Eurostat is proud to announce the winners of the Energy challenge, the second round of nowcasting competition that focused on oil, gas and electricity statistics. The European Statistics Awards Programme on nowcasting challenges experts to produce faster and more accurate estimates of key indicators by applying innovative methods and incorporating alternative, near real-time data sources.  The Energy challenge was structured into 3 competitions, each nowcasting a specific economic indicator: Oil deliveries; Gas consumption;  Electricity availability.  A total of 77 teams comprising 107 participants from 23 countries took part in the challenge. The participants were competing for two different awards: Accuracy for nowcasting accuracy and Rep'),
	(550, 'https://ec.europa.eu/eurostat/documents/4187653/15521404/den-belitsky_AdobeStock_591801869_RV%20(1).jpg', 'In 2023, the EU railway network had 200 947 km of railway lines, with the highest densities being found  in and around main cities and other population hubs.  The highest railway network density was registered in Czechia, with 123.2 metres of railway lines per km². Other EU countries with high densities included Belgium (119.2 m/km²), Germany (109.5 m/km²) and Luxembourg (104.8 m/km²). On the other end, the lowest railway network densities were found in Greece (14.0 m/km²) and Finland (19.4 m/km²). Low densities were also recorded in Sweden (26.8 m/km²), Estonia (27.2 m/km²), Portugal (27.8 m/km²), Latvia (28.9 m/km²) and Ireland (29.8 m/km²). Source datasets: rail_if_line_tr,  reg_area3 and enpe_reg_area3 Expansion of high-speed railway li'),
	(492, 'https://ec.europa.eu/eurostat/documents/2995521/18612587/FamVeld_shutterstock_1661997682_RV.jpg', 'Overview In December 2024, compared with November 2024, the seasonally adjusted retail trade volume decreased by 0.2% in the euro area and by 0.3% in the EU, according to first estimates from Eurostat, the statistical office of the European Union. In November 2024, retail trade volume remained unchanged in the euro area and grew by 0.1% in the EU. In December 2024, compared with December 2023, the calendar adjusted retail sales index increased by 1.9% in the euro area and by 2.0% in the EU. The annual average level of retail trade volume for the year 2024, compared with 2023, increased by 1.0% in the euro area and by +1.3% in the EU. Monthly comparison by retail sector and by Member State In the euro area in December 2024, compared with Nov'),
