	(551, 'https://ec.europa.eu/eurostat/documents/4187653/15989968/exopixel_Shutterstock_251207071_RV.jpg', 'In 2023, personal transfers outflows from the EU (money sent by EU resident households to non-resident households) reached a record level of €50.9 billion, an 8% increase compared with 2022 (€47.0 billion).  The largest share of these outflows went to Asia (excluding the Near and Middle East), accounting for 21% (€10.7 billion) of the total outflows from the EU, followed very closely by non-EU European countries also with 21% (€10.6 billion) and North Africa with 20% (€9.8 billion). This information is based on Eurostat data on personal transfers and compensation of employees. The article highlights key findings from the more detailed Statistics Explained article.  Source dataset: bop_rem6 By contrast, inflows of personal transfers to the E'),
	(552, 'https://ec.europa.eu/eurostat/documents/4187653/15349467/Halfpoint_AdobeStock_423814082_RV.jpg', 'In 2023, 8.1% of people younger than 65 in the EU lived in households with very low work intensity. In these households, members of working age worked up to 20% of their total possible work hours over the previous year. The highest shares of people from 0-64 living in households with very low work intensity were recorded in 2 French outermost regions: Guyane (41.7%) and La Réunion (22.5%). These were followed by Bremen, Germany (21.8%), Prov. Hainaut, Belgium (21.5%), and Campania (21.2%) in Italy.  Source datasets: ilc_lvhl13n and ilc_lvhl21n By contrast, the lowest shares of people living in households with very low work intensity were recorded in Romanian region Bucureşti-Ilfov (0.7%), Austrian regions Salzburg (0.8%) and Tirol (1.1%), B'),
	(493, 'https://ec.europa.eu/eurostat/documents/2995521/18612484/tcsaba_Shutterstock_558736459_RV.jpg', 'Overview In December 2024, compared with November 2024, industrial producer prices increased by 0.4% in both the euro area and the EU, according to first estimates from Eurostat, the statistical office of the European Union. In November 2024, industrial producer prices grew by 1.7% in both the euro area and the EU. In December 2024, compared with December 2023, industrial producer prices remained stable in the euro area and increased by 0.1% in the EU. The annual average of industrial producer prices for the year 2024, compared with 2023, decreased by 4.2% in the euro area and by 4.0% in the EU. Monthly comparison by main industrial grouping and by Member State In the euro area in December 2024, compared with November 2024, industrial produ'),
