	(1, 'https://ec.europa.eu/eurostat/documents/4187653/15963532/EtiAmmos_shutterstock_541051192_RV.jpg', 'The most common form of contingent liabilities in the EU countries is government guarantees on liabilities, and occasionally on assets of third parties. In 2020 and 2021, government guarantees, provided in the EU, increased substantially following the onset of the COVID-19 pandemic. In 2022, the level of government guarantees was further influenced by the energy crisis following Russia’s war of aggression against Ukraine. In 2023, there was a decrease of guarantees in most of the EU countries. In 2023, the highest overall rate of government guarantees was recorded in the Netherlands (30.4% of GDP), Finland (17.9%), Italy (15.3%), Germany (14.6%) and France (13.5%). On the lower end of the scale, rates equal to or less than 1% of GDP were re'),
