	(125, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/cigarettes.jpg?itok=dlGQMi-_', 'An operation coordinated from Eurojust’s headquarters in The Hague has led to the arrest of ten criminals suspected of smuggling 150 containers of over 1.5 billion undeclared cigarettes. German, Belgian and Dutch authorities discovered the activities of the smuggling group following a four-year investigation. The cigarette smuggling resulted in a fiscal loss of around EUR 550 million.'),
	(126, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/web-de-sl-labour-case.jpg?itok=en_cT4Jh', 'German and Slovenian authorities, with the support of Eurojust, conducted a coordinated action today against the illegal trafficking and posting of foreign building labourers and tax evasion. During the action day, the three main suspects were arrested in Germany. Their illegal activities deprived the German tax authorities of approximately EUR 12 million.'),
