	(3, 'https://ec.europa.eu/eurostat/documents/4187653/18025247/Andrei%20Armiagov_AdobeStock_99681660_RV%20(1).jpg', 'In 2022, EU exports of spacecraft and space transport services totalled €1 340 million after experiencing a 36% drop compared with 2021 (€2 108 million). In 2022, 84% of all exports, or €1 129 million, went to countries outside the EU. The EU exports peaked in 2012, at €3 273 million, and declined until they fell to €1 913 million in 2016. A sharp recovery occurred in 2017, with exports rising to €2 961 million, before significant drops occurred, notably in 2020, when exports fell to €1 562 million due to the impact of the COVID-19 pandemic.  Source dataset: data on the European space economy (based on FIGARO balanced view of international trade) EU imports of spacecraft and space transport services amounted to €1 274 million in 2022, a 33%'),
	(4, 'https://ec.europa.eu/eurostat/documents/4187653/17000068/Aerial%20Drone%20Master_AdobeStock_564658519_RV.jpg', 'In 2020, 40% of all agricultural holdings (farms) in the EU had manure storage facilities. The highest shares of farms with manure storage facilities were in Slovenia (nearly 100%), Latvia (98%) and Estonia (92%). By contrast, the lowest shares were recorded in Cyprus (7%), Greece (11%) and Italy (18%). This information comes from the 2020 agricultural census data on manure storage  published by Eurostat today. This news item presents a handful of findings from the more detailed Statistics Explained article on manure storage. Source dataset: ef_mp_ms  Decline in use of uncovered liquid manure storage reduces environmental risks In 2020, 57% of farms with manure storage infrastructure had facilities for storage of solid dung, 16% had covered'),
	(5, 'https://ec.europa.eu/eurostat/documents/4187653/15917735/mimadeo_AdobeStock_263952481_RV.jpg', 'In the latest episode of the Eurostat podcast Stats in a Wrap, we look into what data can tell us about living in the EU’s countryside. Rural communities make up nearly 30% of the EU population and account for around 80% of its territory. Rural areas are remarkably diverse, from sprawling agricultural landscapes to smaller towns with their own unique economies and cultures. The EU’s rural areas are also often perceived in different ways. For some, they are romantic havens from the stress of city life. For others, they are tough places to get work, healthcare and education. But it is data that can help us change or confirm our perceptions about rural life in Europe. Our host Jonathan Elliot is joined by Marina Royo de Blas, who’s part of the'),
	(253, 'https://static.dw.com/image/71440567_6.jpg', 'Early reports suggested at least seven people had died, perhaps more, in a stampede at a Hindu gathering in the city of Prayagraj. Researchers in Germany have tried to explain such events since a tragedy here in 2010.'),
