	(127, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/web-money-laundering-case-01-25.jpg?itok=fabMw0QQ', 'An international investigation spanning several years has led to the arrest of 23 criminals running a sophisticated money laundering scheme. The group acted as a financial service for other criminals to launder their profits. The scheme facilitated the laundering of approximately EUR 100 million. An international coalition of Spanish, Cypriot and German authorities, with support of the French authorities and Eurojust and Europol, was established to dismantle the group. The takedown resulted in the seizure of over EUR 8 million in cash and the freezing of EUR 27 million in cryptocurrencies.'),
