	(8, 'https://ec.europa.eu/eurostat/documents/4187653/15989968/allstars_Shutterstock_108661346_RV.jpg', 'In 2022, EU market producer enterprises controlled by countries outside the EU generated a net turnover of €5 657 billion, equivalent to 14.7% of all net turnover generated by EU enterprises (€38 494 billion).  At the same time, enterprises outside the EU, controlled by an EU resident institutional units, generated €6 526 billion of net turnover.  Enterprises in the United States contributed with the highest share (€2 030 billion, 31.1%) followed by the United Kingdom (€770 billion, 11.8%), China (€570 billion, 8.7%), Mexico (€190 billion, 2.9%), Canada (€181 billion, 2.8%) and Australia (€132 billion, 2.0%).  Source dataset: fats_out_part When it came to net turnover generated by enterprises in the EU controlled by countries outside the EU'),
