	(9, 'https://ec.europa.eu/eurostat/documents/4187653/15566032/Liubov%20Levytska_AdobeStock_219832523_RV.jpg', 'In 2024, 33% of EU internet users reported that they had done an online course or used online learning material in the 3 months prior to the survey. This is a 3 percentage point (pp) increase compared with 2023 (30%). Ireland recorded the highest share of internet users engaged in online learning (61%), followed by the Netherlands (59%) and Finland (53%). By contrast, online education was less prevalent in Romania (10%), Cyprus (11%) and Bulgaria (17%). Source dataset: isoc_ci_ac_i When considering specific online learning methods, 18% of internet users did an online course in 2024, which was most prevalent in Ireland (36%), Finland and Spain (both 32%). At the same time, 29% internet users used online learning materials, with the highest s'),
	(295, 'https://static.dw.com/image/71386577_6.jpg', 'Flowers are meant to smell nice. This one doesn\'t. And thousands want to see — and smell it — for themselves.'),
