	(296, 'https://static.dw.com/image/71379852_6.jpg', 'Berlin blames Bavaria. Bavaria blames Berlin. With migrants suspected in several deadly attacks, German politicians are jostling for position with calls to reform migration ahead of February\'s federal election.'),
