	(128, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/nl-de-press-release-explosions.jpg?itok=8bJ1N9pv', 'Eurojust has supported the German and Dutch authorities in stopping a series of severe retaliatory attacks between criminals using explosives and firearms to settle scores. A total of 23 suspects have been arrested, including three during an action day this week. Eurojust assisted with the execution of European Arrest Warrants (EAWs) and European Investigation Orders (EIOs) and coordinated the judicial cooperation between the authorities.'),
