	(18, 'https://ec.europa.eu/eurostat/documents/2995521/18612440/SeventyFour_AdobeStock_282123716_RV.jpg', 'Overview The euro area annual inflation rate was 2.4% in December 2024, up from 2.2% in November. A year earlier, the rate was 2.9%. European Union annual inflation was 2.7% in December 2024, up from 2.5% in November. A year earlier, the rate was 3.4%. These figures are published by Eurostat, the statistical office of the European Union. The lowest annual rates were registered in Ireland (1.0%), Italy (1.4%), Luxembourg, Finland and Sweden (all 1.6%). The highest annual rates were recorded in Romania (5.5%), Hungary (4.8%) and Croatia (4.5%). Compared with November 2024, annual inflation fell in seven Member States, remained stable in one and rose in nineteen. In December 2024, the highest contribution to the annual euro area inflation rate'),
