	(130, 'https://www.eurojust.europa.eu/sites/default/files/styles/banner/public/assets/images/european-commissioner-mcgrath-eurojust.jpg?itok=3-zwWqlh', 'As a key player in global criminal justice cooperation, Eurojust works together with the European Commission to keep Europe safe. To mark the start of his mandate, European Commissioner for Democracy, Justice and the Rule of Law Michael McGrath visited  Eurojust’s headquarters in The Hague on 16 January. Commissioner McGrath was welcomed by Eurojust President Michael Schmid and the two Vice-Presidents, Ms Margarita Šniutytė-Daugėlienė and Mr  José de la Mata Amaya, who presented the various ways the Agency supports authorities across Europe and beyond in their cross-border investigations.'),
	(19, 'https://ec.europa.eu/eurostat/documents/2995521/18612563/kanpisut_AdobeStock_645720442_RV.jpg', 'Euro area The first estimates of euro area balance showed a €16.4 bn surplus in trade in goods with the rest of the world in November 2024, compared with + €18.2 bn in November 2023. The euro area exports of goods to the rest of the world in November 2024 were €248.3 billion, a decrease of 1.6% compared with November 2023 (€252.4 bn). Imports from the rest of the world stood at €231.9 bn, a fall of 1.0% compared with November 2023 (€234.2 bn). In November 2024 the euro area surplus increased compared to October 2024, from €8.6 bn to €16.4 bn. This increase was mainly due to an increase in the surplus for chemicals and related products (from €+20.7 bn to €+23.4 bn) and a shift in the balance for other manufactured goods (from €-1.2 bn to €+1'),
