	(2044, 'https://static.euronews.com/articles/stories/08/34/13/32/1200x675_cmsv2_7ad4088a-8013-5a95-9ca5-f175ae2c6407-8341332.jpg', 'The upcoming launch of the EU\'s digital border management system, scheduled for this autumn, raises concerns regarding data protection, asylum law and the rights of children. #EuropeNews'),
	(2045, 'https://www.politico.eu/cdn-cgi/image/width=1200,height=630,fit=crop,quality=80,onerror=redirect/wp-content/uploads/2025/03/07/GettyImages-2202960032-scaled.jpg', 'Plans to announce a large package of military aid for Ukraine fizzled ahead of the gathering.'),
	(2046, 'https://www.politico.eu/cdn-cgi/image/width=1200,height=630,fit=crop,quality=80,onerror=redirect/wp-content/uploads/2025/03/07/GettyImages-2203683391-scaled.jpg', 'As desperate European leaders beg the U.S. president to let them join peace talks, is he even listening?'),
	(2047, 'https://www.politico.eu/cdn-cgi/image/width=1200,height=630,fit=crop,quality=80,onerror=redirect/wp-content/uploads/2025/03/07/GettyImages-2202960032-scaled.jpg', 'Plans to announce a large package of military aid for Ukraine fizzled ahead of the gathering.'),
	(2048, NULL, NULL),
	(2049, 'https://www.politico.eu/cdn-cgi/image/width=1200,height=630,fit=crop,quality=80,onerror=redirect/wp-content/uploads/2025/03/07/GettyImages-2201304806-scaled.jpg', 'Kristen Michal tells POLITICO that no country should shirk its obligations as U.S. casts doubt on NATO security.'),
	(2050, 'https://static.dw.com/image/71852138_6.jpg', 'Almost 50 people were killed in clashes between security forces and pro-Assad gunmen in Latakia, once the stronghold of the Assad family. The government has tried to play down sectarian tensions.'),
	(2051, 'https://www.politico.eu/cdn-cgi/image/width=1200,height=630,fit=crop,quality=80,onerror=redirect/wp-content/uploads/2025/03/07/GettyImages-2198433849-scaled.jpg', 'John Healy tells Pete Hegseth that Europe is meeting Washington’s challenge to “step up” on security and Ukraine.'),
	(2052, 'https://www.politico.eu/cdn-cgi/image/width=1200,height=630,fit=crop,quality=80,onerror=redirect/wp-content/uploads/2025/03/04/GettyImages-2199291171-scaled.jpg', 'Is this really it? One President Donald Trump’s toddler tantrum, and we’re toast?'),
	(2053, 'https://www.politico.eu/cdn-cgi/image/width=1200,height=630,fit=crop,quality=80,onerror=redirect/wp-content/uploads/2025/03/06/GettyImages-2203036277-scaled.jpg', 'Losing faith in Washington as a military ally, Berlin wants to rip up the old fiscal orthodoxy. But it’s now a race against the clock.'),
	(2054, 'https://www.politico.eu/cdn-cgi/image/width=1200,height=630,fit=crop,quality=80,onerror=redirect/wp-content/uploads/2025/03/07/GettyImages-2203288369-scaled.jpg', 'Amman this week welcomed the first convoy of sick and injured children from Gaza. '),
	(2055, 'https://www.politico.eu/cdn-cgi/image/width=1200,height=630,fit=crop,quality=80,onerror=redirect/wp-content/uploads/2021/10/29/EU-Confidential-Website-Card.png', 'This week’s episode of EU Confidential comes to you from Thursday’s emergency meeting of EU leaders — the political equivalent of sobbing into your pillow on a sleepless night. The reason for those…'),
	(2056, 'https://www.politico.eu/cdn-cgi/image/width=1200,height=630,fit=crop,quality=80,onerror=redirect/wp-content/uploads/2021/10/29/Westminster-Insider-Website-Card.png', 'Have you ever wondered about COBRA? Not the snake or the yoga pose — but Cabinet Office Briefing Room A, the place at the heart of Whitehall where a highly sensitive, critical government committee …');
